CREATE FUNCTION [dbo].[cplQuotationDiscountNet]
(
	@quotationId INT
)
RETURNS DECIMAL(12, 2)
AS

BEGIN
	RETURN ISNULL((SELECT SUM(DiscountTot) FROM TblQuotationDetail WHERE QuotationId = @quotationId), 0);
END

CREATE FUNCTION [dbo].[cplQuotationDiscountTot]
(
	@quotationId INT
)
RETURNS DECIMAL(12, 2)
AS

BEGIN
	RETURN ISNULL((SELECT SUM(DiscountVat) FROM TblQuotationDetail WHERE QuotationId = @quotationId), 0);
END

CREATE FUNCTION [dbo].[cplQuotationDiscountVat]
(
	@quotationId INT
)
RETURNS DECIMAL(12, 2)
AS

BEGIN

	DECLARE @oid varchar(20);
	DECLARE @pre varchar(10);
	DECLARE @dnow varchar(10);
	DECLARE @runid int;
	set @dnow='QU' + (select FORMAT(GETDATE(),'ddMMyy','th-TH'));
	set @oid = (Select MAX(QuotationNo) from TblQuotation);
	set @pre=isnull(LEFT(@oid,8),@dnow);
	set @runid=isnull(TRY_CONVERT(int,RIGHT(@oid ,3)),1);

	if (@oid=@dnow)
		set @runid=@runid+1;
	else
		set @runid=1;

	RETURN @dnow + '-' + FORMAT(@runid,'000');

END

BEGIN
